import React, { Component } from 'react';
import { Link } from "react-router-dom";



class Navbar extends Component {
    constructor(props){
        super(props);
        const auth = sessionStorage.getItem('userAuth');

        this.state = {
            navitems:[
                {
                    id: 1,
                    hash: "home",
                    name: "Home",
                    path : "/"
                },
                {
                    id: 2,
                    hash: "login",
                    name: "Login",
                    path : "/login"
                },
                {
                    id: 3,
                    hash: "signup",
                    name: "Signup",
                    path : "/signup"
                },
                {
                    id: 4,
                    hash: "profile",
                    name: "Profile",
                    path : "/profile"
                }, 
                {
                    id: 5,
                    hash: "logout",
                    name: "Logout",
                    path : "/logout"
                },
            ]
        }
        if(auth !== 'Success'){
            ("li#login").hide()
        }

    }
    render() {
        return this.state.navitems.map( nav => {
            return(
                <div>
                    <ul>
                        <li key={nav.id} id={nav.hash} className="item-card">
                            <Link to={nav.path}>{nav.name}</Link>
                        </li>
                    </ul>
              </div>
              );
          }
        )
    };
}

export default Navbar;
